import React from 'react';
import dylan from '../../Images/Dylan.png'

const Intro = () => {
    return(
        <div className='intro'>
            <div style={{width: '35vw', textAlign: 'right', paddingRight: '5rem'}}>
                <img className='photo' src={dylan}/>
            </div>
            <section style={{width: '65vw', textAlign: 'left', height: '20vh' ,padding: '0rem, 20rem', lineHeight: '2rem'}}>
                <p>Educated entry level full-stack software developer seeking to gain employment as a Front-end React developer or Back-end Node developer where I can provide immediate value to a team and grow as an employee.</p>
            </section>
        </div>
    )
}

export default Intro;
